import { Link } from "react-router-dom";
const events = [
  { id: "e1", name: "event-1" },
  { id: "e2", name: "event-2" },
  { id: "e3", name: "event-3" },
  { id: "e4", name: "event-4" },
];
export default function EventsPage() {
  return (
    <>
      <h1>Events page</h1>
      <ul>
        {events.map((event) => (
          <li key={event.id}>
            <Link to={`/events/${event.id}`}>{event.name}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
